messages.content:
@here I have taken on board everything that has been said regarding taking on a fourth faction. As noted by Kapen, one potential option we’re exploring is to merge YW and BW into one 3m+ respect faction and take on MoM.

I have explained to MoM that I feel it would be best for a number of their members to join into the family and get a taste of what we’re like. Leaving their faction ticking over until a time we’re ready to move with it. While the faction itself does pose complications in terms of running, my main interest in this acquisition is the securing of their active stat and CE beasts.

Of course we do not need to proceed at all. Please use ✅ or ❎ to vote whether you agree to my “come join us for a few months and then we’ll make your faction a fully fledged Wolverine (providing we have either merged YW and BW or have navigated the leadership minefield).

@Council @Leadership 
Thank you to everyone who voted/submitted names. 
With 0 votes for Wolverine Veterinarians, 14 votes for Wolverine Health Organization (WHO), and 13 votes for Wolverines Gone Medical, BW will officially be renamed to Wolverine Health Organization (WHO)!
